// Bounds [minLng, minLat, maxLng, maxLat]

// 瓦片更新显示策略
export var UpdateTileStrategy = /*#__PURE__*/function (UpdateTileStrategy) {
  UpdateTileStrategy["Realtime"] = "realtime";
  UpdateTileStrategy["Overlap"] = "overlap";
  UpdateTileStrategy["Replace"] = "replace";
  return UpdateTileStrategy;
}({});
export var LoadTileDataStatus = /*#__PURE__*/function (LoadTileDataStatus) {
  LoadTileDataStatus["Loading"] = "Loading";
  LoadTileDataStatus["Loaded"] = "Loaded";
  LoadTileDataStatus["Failure"] = "Failure";
  LoadTileDataStatus["Cancelled"] = "Cancelled";
  return LoadTileDataStatus;
}({});
